import React from 'react';
import { Typography } from 'antd';
import { ALL_LANDS } from '../../data';
import { LandContainer } from './styles';

const { Title } = Typography;

const Land = () => {

  return (
    <LandContainer>
      {ALL_LANDS.map(land => (
        <div key={ land.title }>
          <div className="land-card-img" />
          <Title level={4}>{ land.title }</Title>
          <p>{ land.description }</p>
        </div>
      ))}
    </LandContainer>
  );
}

export default Land;
